import { useState } from 'react';
import SkillBar from './SkillBar';
import {Card} from '@mui/material';
import {PieChart, Pie,BarChart, XAxis, YAxis, Tooltip, Legend, Bar,CartesianGrid} from 'recharts';


export default function Dashboard() {
    const exp_data = [
        {
            "skill": "ETL/ELT",
            "exp": 4
        },
        {
            "skill": "Python",
            "exp": 3
        },
        {
            "skill": "SQL",
            "exp": 4,

        },
        {
            "skill": "Generative-AI",
            "exp": 1
        },
        {
            "skill": "Machine Learning",
            "exp": 2
        }
    ]



    return (
        <div
            className="dash-container"
            style={{
                display:"flex"
            }}
        >
            <Card>
                <SkillBar />
            </Card>

            <Card
                className="skill-exp-pie"
                >
                    <PieChart width={300} height={300} >
                        <Tooltip />
                        <Pie data={exp_data} dataKey="exp" nameKey="skill" fill='#8884d8' />
                    </PieChart>

            </Card>


</div>
    );
}
